export function uchat_connect_waiting(){
    uchat_connected_setTimeout = setTimeout(function(){
        
        var $head = $("head");
        var $script, script;
        $script = $head.find("script");
        if($script.length !== 0){
            for(var i=0; i<$script.length; i++){
                script = $script[i];
                if(script.src.indexOf("load.php") !== -1){
                    ADD_DEBUG("유챗 연결 기다리는 중...");

                    var $template = $(`
                        <div class="uchat_connect_dom" style="
                        box-sizing: border-box;
                        color: black;
                        position: fixed;
                        top: calc(50% - 90px);
                        left: calc(50% - 150px);
                        padding: 10px;
                        font-size: 15px;
                        width: 300px;
                        height: auto;
                        z-index: 100000000000000000000;
                        background: #ddd;
                        text-align: center;
                        cursor: pointer;
                        border: 1px solid #333;
                        font-family: "Noto Sans KR", "맑은 고딕", malgun gothic, dotum, serif;
                    ">Uchat Waiting···<br />강제연결 시도 <span style="font-size:13px;">(테스트 중)</span></div>
                    `);
                    $("body").append($template);
                    $template.on("click", function(){
                        uchat_force_connect();
                        $(".uchat_connect_dom").hide();
                    });
                }
            }
        }
    },2000);
}

export function uchat_connect_check_clear(){
    ADD_DEBUG("유챗 강제 연결 clear");
    $(".uchat_connect_dom").remove();
    clearTimeout(uchat_connected_setTimeout);
}